import { booksByGenre } from "./Api";

export function GetBookByID(bookID) {
  console.log(book)
  for (const [genre, books] of Object.entries(booksByGenre)) {
    for (const book of books) {
      if (book.bookID === bookID) {
        return book;
      }
    }
  }
  return null;
}
